import React, { useState } from "react";

import { Container, Grid, Paper, Typography, Button } from "@material-ui/core";


const UserHome = () => {

    const [userNav, setUserNav] = useState({
        page: "Towns"
    })

    switch(userNav.page) {
        case "Towns":
            return (
                <div>
                    Towns Page
                </div>
            )
        case "News":
            return (
                <div>
                    News Page
                </div>
            )
        default: 
            return (
                <Container>
                    <Paper>
                        <Grid container>
                            <Grid item md="12">
                                <Typography>
                                    No Profile Found
                                </Typography>

                                <Button>CREATE PROFILE</Button>
                            </Grid>
                        </Grid>
                    </Paper>
                </Container>
            )
    }
}

export default UserHome;
